  input: TEXT,F3XA,,"The amendment reponds to your letter of December 14, 2004.  The
    beginning cash balance of this report should be correct because of amendments
    to previous reports.  The totals on the summary and detailed summary pages should
    also now be correct.  At the time the report was originally filed, staff was unaware
    that salaries were no longer allocable.  We have disclosed the salaries and related
    expenses on line 21B.  These employees should have been paid from a nonfederal
    account; none of the employees met the definition of a Federal Election Activity.
    We will be reviewing our non-federal transfer activity to determine if any overtransfers
    were made and will take corrective action if necessary.  We have clarified the
    disbursement to the Travis County Democratic Party-State and have attached memo
    text to the affected transactions. Schedule C no longer reflects an outstanding
    debt to Travis County Democratic Primary Fund because this debt was extinguished
    in May 2003."
